```json
{
  "application": "VASP",
  "details": {
    "software": [
      "intel-mpi/2018.0.3",
      "mkl/2018.3.222",
      "cuda/10.2.89",
      "vasp_gpu (version 6.1.2)"
    ],
    "resources": {
      "nodes": 4,
      "time": "4:00:00",
      "gres": "gpu:2",
      "tasks": 32 
    }
  }
}
``` 

**Explanation:**

* **Application:** The script uses the `vasp_gpu` executable, indicating it's running the Vienna Ab-initio Simulation Package (VASP).
* **Software:** The script loads specific versions of Intel MPI, MKL, and CUDA libraries. It also uses the `vasp_gpu` executable from a specific path.
* **Resources:** The script requests 4 nodes, a runtime of 4 hours, 2 GPUs, and a total of 32 tasks (calculated as 4 nodes * 8 ranks per node).
